import React from "react";
import useTweets from "./utils/useTweets"

function App() {
const tweets = useTweets()

	return (
		<div>
			<ol className="tweets-list">
				{tweets.map((tweet) => (
					<li>{tweet.data.text}</li>
				))}
			</ol>
		</div>

		// <p>
		//   It's <time dateTime={tweets}>{tweets}</time>
		// </p>
	);
}

export default App;





